import Header from './Header';
import Head from 'next/head';
import Meta from './others/meta';


const Layout = ({sortList, children, title}) => {
    console.log(sortList, children, title);
    return (
        <div>
            <Meta />
            <Head>
                <title>{title?title:'ELEVEN'}</title>
            </Head>
            <Header sortList={sortList}/>
            {children}
        </div>
    )
}

export default Layout
